INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, 0.0, 102301, "アヤネ", 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 401, 24001, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 102301, "アヤネ", 2.21, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 402, 24002, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, 0.0, 102301, "アヤネ", 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 403, 24003, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, 0.0, 192201, "アサヒ", 1.99, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 701, 24004, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 192201, "アサヒ", 2.21, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 702, 24005, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, 0.0, 192201, "アサヒ", 3.33, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 703, 24006, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, 0.0, 192301, "部員３", 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 801, 24007, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 192301, "部員３", 2.68, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 802, 24008, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, 0.0, 192301, "部員３", 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 803, 24009, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 1, 0.0, 192501, "", 0.0, 0.0, "やった！", 501, 24010, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 1, 0.0, 192501, "", 0.0, 0.0, "勝ったよ！", 502, 24011, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 1, 0.0, 192501, "", 0.0, 0.0, "いい調子！", 503, 24012, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 6, 0.0, 113501, "ミサト", 5.33, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 111, 24013, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 113501, "ミサト", 6.85, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 112, 24014, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 113501, "ミサト", 3.0, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 113, 24015, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 192401, "ダイチ", 6.11, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 611, 24016, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 192401, "ダイチ", 6.75, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 612, 24017, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, 0.0, 192401, "ダイチ", 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 613, 24018, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, 0.0, 113401, "ハツネ", 4.52, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 211, 24019, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, 0.0, 113401, "ハツネ", 3.89, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 212, 24020, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 113401, "ハツネ", 13.49, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 213, 24021, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 106501, "カヤ", 3.17, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 311, 24022, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, 0.0, 106501, "カヤ", 4.42, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 312, 24023, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 6, 0.0, 106501, "カヤ", 2.89, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 313, 24024, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 3, 4, 0.0, 102301, "アヤネ", 3.71, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 421, 24025, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, 0.0, 192201, "アサヒ", 5.1, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 721, 24026, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 3, 1, 0.0, 192301, "部員３", 4.34, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 821, 24027, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 1, 0.0, 192501, "", 0.0, 0.0, "いい勝負だったよ\nまたやろうね", 521, 24028, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, -360.0, 113501, "ミサト", 5.62, 0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 101, 24029, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, -360.0, 113501, "ミサト", 9.58, 0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 102, 24030, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 2, -360.0, 113501, "ミサト", 0.0, 0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 103, 24031, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 1, 2, -360.0, 113501, "ミサト", 9.13, 0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 104, 24032, "2030/12/17 14:59:59");
INSERT INTO `v1_c85603f6750c0194e95058dd744a227769867aceaf83f4e3daf4e05833629faf` VALUES ("2020/07/31 12:00:00", 10046, 24, 2, 1, -360.0, 113501, "ミサト", 8.27, 0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 105, 24033, "2030/12/17 14:59:59");
